import { Button, Card, CardContent, CardHeader, Dialog, DialogTitle, TextField, Typography } from "@mui/material";
import axios from "axios";
import { useState } from "react";
import Routing from "../../Routing/Routing";
import globals from "../../Services/Globals";
import "./Main.css";


export interface SimpleDialogProps {
    open: boolean;
    selectedValue: string;
    onClose: (value: string) => void;
  }

  function SimpleDialog(props: SimpleDialogProps) {
    const { onClose, selectedValue, open } = props;

    const handleClose = () => {
      onClose(selectedValue);
    };

    const handleListItemClick = (value: string) => {
      onClose(value);
    };

    return (
      <Dialog onClose={handleClose} open={open}>
        <DialogTitle>Set backup account</DialogTitle>
        <List sx={{ pt: 0 }}>
          {emails.map((email) => (
            <ListItem disableGutters>
              <ListItemButton onClick={() => handleListItemClick(email)} key={email}>
                <ListItemAvatar>
                  <Avatar sx={{ bgcolor: blue[100], color: blue[600] }}>
                    <PersonIcon />
                  </Avatar>
                </ListItemAvatar>
                <ListItemText primary={email} />
              </ListItemButton>
            </ListItem>
          ))}
          <ListItem disableGutters>
            <ListItemButton
              autoFocus
              onClick={() => handleListItemClick('addAccount')}
            >
              <ListItemAvatar>
                <Avatar>
                  <AddIcon />
                </Avatar>
              </ListItemAvatar>
              <ListItemText primary="Add account" />
            </ListItemButton>
          </ListItem>
        </List>
      </Dialog>
    );
  }


function Main(): JSX.Element {

    const [phone, setPhone] = useState<string>("");

    const phoneQuery = async () => {
         axios.get<boolean>(globals.urls.phoneQuery + phone)
         .then((res) => {

         })
         ;
      }

    return (
        <div className="Main">  

       <Dialog onClose={handleClose} open={open}>
      <DialogTitle>Set backup account</DialogTitle>
          </Dialog>


        <Card sx={{ m: 15 }}>
                <Typography sx={{mt: 5}}>
                   הזן מספר טלפון לבדיקה
                </Typography>

            <CardContent>
        <TextField
         fullWidth 
         onChange={() => setPhone} 
         variant="filled" />
        <Button sx={{ m: 3 }} variant="contained" color="primary"> בדיקה במאגר</Button>
        </CardContent>
        </Card>
        </div>
    );
}

export default Main;
